import React from 'react';
import logo from "../../Image/logo1.png";
import {Link,BrowserRouter} from "react-router-dom";



const Header = () => {
  return (
    <>
     <BrowserRouter>
     <nav className='navbar'>
      <div className="logo">
        <img src={logo} alt="logImg" />
      </div>
      
      <Link to="/home"><li>Home</li></Link>
      
     </nav>
     </BrowserRouter>
    </>
  )
}

export default Header
